import React, { useEffect, useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';

const Home = () => {
  const [username, setUsername] = useState('');
  const [showMenu, setShowMenu] = useState(false);
  const [showDropdown, setShowDropdown] = useState(false);
  const [selectedName, setSelectedName] = useState(null);

  const [list] = useState([
  { Name: 'Service A', stateName: 'A1' },
  { Name: 'Service B', stateName: 'B1' },
  { Name: 'Service C', stateName: 'C1' },
]);


  const navigate = useNavigate();

  useEffect(() => {
    const storedUser = localStorage.getItem('user');
    if (storedUser) {
      const user = JSON.parse(storedUser);
      setUsername(user.user_id);
    } else {
      navigate('/');
    }
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('user');
    navigate('/');
  };

  const handleChangePassword = () => {
    navigate('/change-password');
  };

  const handleSelectChange = (event) => {
    const selected = list.find(item => item.stateName === event.target.value);
    setSelectedName(selected);
    console.log('Selected service:', selected);
    // If you want to trigger something else, do it here
  };

  return (
    <div className="min-h-screen bg-gray-100">
      {/* Header */}
      <div className="bg-[#2e5d95] text-white flex justify-between items-center px-6 py-3 shadow relative">
        <Link to="/">
          <div className="text-lg font-semibold">Home</div>
        </Link>
        <div className="text-xl font-bold">Head of Division</div>

        <div className="relative">
          <div
            className="text-sm font-semibold cursor-pointer"
            onClick={() => setShowMenu(!showMenu)}
          >
            {username} â–¾
          </div>
          {showMenu && (
            <div className="absolute right-0 mt-2 w-48 bg-white text-black shadow-md rounded z-10">
              <button
                onClick={handleChangePassword}
                className="block w-full px-4 py-2 text-left hover:bg-gray-100"
              >
                Change Password
              </button>
              <button
                onClick={handleLogout}
                className="block w-full px-4 py-2 text-left hover:bg-gray-100"
              >
                Logout
              </button>
            </div>
          )}
        </div>
      </div>

      {/* Body */}
      <div className="p-6">
        {/* Top Button */}
        <div className="flex justify-start gap-4 mb-6">
          <button
            className="bg-[#2e5d95] text-white px-4 py-2 font-semibold rounded shadow hover:bg-blue-800"
            onClick={() => setShowDropdown(!showDropdown)}
          >
            Create Project Request
          </button>
        </div>

        {/* Conditional Dropdown */}
        {showDropdown && (
          <div className="container bg-white p-4 rounded shadow-md">
            <div className="row mb-4">
              <label className="mr-2 text-lg font-medium">Select :</label>
              <select
                className="border px-3 py-1 rounded"
                value={selectedName?.stateName || ''}
                onChange={handleSelectChange}
              >
                <option value="" disabled>
                  -- Select Service --
                </option>
                {list.map((li) => (
                  <option key={li.stateName} value={li.stateName}>
                    {li.Name}
                  </option>
                ))}
              </select>
            </div>
            {selectedName && (
              <div className="text-gray-700">
                Selected: <strong>{selectedName.Name}</strong>
              </div>
            )}
          </div>
        )}

        {/* Divider */}
        <hr className="border-dashed border-t-2 border-[#2e5d95] my-6" />

        {/* Center Button */}
        <div className="flex justify-center">
          <button className="bg-[#2e5d95] text-white px-4 py-2 font-semibold rounded shadow hover:bg-blue-800">
            Requested Service
          </button>
        </div>
      </div>
    </div>
  );
};

export default Home;
